import React from 'react';
import { Link } from 'react-router-dom';
import HeaderLogo from '../../../../assets/images/img-dashboard-store.svg';
// import HeaderLogo from '../../../../assets/images/logo-large.svg';

const HeaderPage = () => {
    return (
        <div className="header-page">
            <Link to="/">
                <img src={HeaderLogo} alt="" className="not-found-image-header" />
            </Link>
        </div>
    );
};

export default HeaderPage;
